import React from 'react';
// import portfolioDB from './DB/portfolioDB';
const portfolioDB = {
  users: [
    {
      id: 346364,
      name: 'Chance Lipshutz',
      school: 'California College of the Arts',
      major: 'Illustration',
      Year: 2020,
      Portfolio: [{ img: [], desc: '' }],
    },
  ],
};

function PortfolioCard(props) {
  return (
    <div className="PortfolioCard">
      <img alt="main_img" />
      <p>California College of the Arts</p>
      <p>Illustration</p>
      <p>
        {props.portfolioDB.users.name}
        <span>2020</span>
      </p>
    </div>
  );
}

export default PortfolioCard;
